INSERT INTO season VALUES (12, "2022-01-17 20:28:13.0", "2022-01-17 20:28:13.0", "AVES", 16, "Aves Season 12", 12, "This was the first season scheduled with HOME_ROTATION_RANDOM which made it very hard to tell which teams were doing well. This was also the first season played after implementing the Game Events feature making it easier to keep track of when goals were scored in the game. Blue Jay started hot winning their first 7 games, which included a comeback from 5-1 down in the third period. They appeared to fade off and several other teams seemed to have an equal or better chance to take the season. The most notable challenger was Woodpecker who one 12 of 13 at one point. Woodpecker's Point Percentage was 81.3% when Blue Jay's was 68.4%. The race was on between those two teams down the stretch. Neither team finished strong but Blue Jay was better and finished on top in Season 12.", "HOME_ROTATION_RANDOM"); INSERT INTO standing VALUES (112, "2022-01-17 20:28:14.0", "2022-12-09 20:49:18.0", 12, 12, 19, 8, 0, 3, 41, 30, 83, 73, 12, 3, 0, 0, 24, 15, 7, 5, 0, 3, 17, 15, 1),(108, "2022-01-17 20:28:14.0", "2022-12-09 20:49:18.0", 12, 8, 19, 11, 0, 0, 38, 30, 91, 66, 10, 5, 0, 0, 20, 15, 9, 6, 0, 0, 18, 15, 2),(114, "2022-01-17 20:28:14.0", "2022-12-09 20:49:18.0", 12, 14, 18, 10, 0, 2, 38, 30, 102, 86, 12, 3, 0, 0, 24, 15, 6, 7, 0, 2, 14, 15, 3),(110, "2022-01-17 20:28:14.0", "2022-12-09 20:49:18.0", 12, 10, 16, 8, 0, 6, 38, 30, 82, 71, 9, 3, 0, 3, 21, 15, 7, 5, 0, 3, 17, 15, 4),(111, "2022-01-17 20:28:14.0", "2022-12-09 20:49:18.0", 12, 11, 16, 8, 0, 6, 38, 30, 91, 81, 8, 5, 0, 2, 18, 15, 8, 3, 0, 4, 20, 15, 5),(102, "2022-01-17 20:28:13.0", "2022-12-09 20:49:18.0", 12, 2, 17, 13, 0, 0, 34, 30, 83, 74, 9, 6, 0, 0, 18, 15, 8, 7, 0, 0, 16, 15, 6),(101, "2022-01-17 20:28:13.0", "2022-12-09 20:49:18.0", 12, 1, 16, 13, 0, 1, 33, 30, 77, 76, 9, 6, 0, 0, 18, 15, 7, 7, 0, 1, 15, 15, 7),(104, "2022-01-17 20:28:14.0", "2022-12-09 20:49:18.0", 12, 4, 15, 12, 0, 3, 33, 30, 89, 8