INSERT INTO season VALUES (13, "2022-09-11 23:00:22.0", "2022-09-29 17:34:09.0", "AVES", 8, "Aves Season 13", 21, "Flamingo dominates on the away games and wins season 13 after finishing dead last out of 32 teams in their only previous season (season 5). Attention was on Penguin, the winners of season 5, and they were a contender, but a home loss against Flamingo around halfway through the season was a turning point in Penguin's season and in the season at large. Sea Gull was the only threat down the stretch and made things interesting as Flamingo struggled to take advantage of several home games. But Sea Gull lost their second to last game in OT, which was the moment it was sealed for Flamingo. If Sea Gull had scored in that OT they would have tied Flamingo in points but Flamingo would still have won on the goal diff tiebreaker.", "HOME_ROTATION_RANDOM"); INSERT INTO standing VALUES (121, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 21, 10, 3, 0, 1, 21, 14, 51, 40, 4, 2, 0, 1, 9, 7, 6, 1, 0, 0, 12, 7, 1),(118, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 18, 9, 3, 0, 2, 20, 14, 36, 28, 7, 0, 0, 0, 14, 7, 2, 3, 0, 2, 6, 7, 2),(119, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 19, 8, 6, 0, 0, 16, 14, 43, 43, 4, 3, 0, 0, 8, 7, 4, 3, 0, 0, 8, 7, 3),(117, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 17, 7, 6, 0, 1, 15, 14, 36, 31, 2, 4, 0, 1, 5, 7, 5, 2, 0, 0, 10, 7, 4),(123, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 23, 6, 6, 0, 2, 14, 14, 38, 49, 2, 4, 0, 1, 5, 7, 4, 2, 0, 1, 9, 7, 5),(124, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 24, 6, 7, 0, 1, 13, 14, 40, 43, 2, 4, 0, 1, 5, 7, 4, 3, 0, 0, 8, 7, 6),(122, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 22, 5, 8, 0, 1, 11, 14, 49, 50, 2, 5, 0, 0, 4, 7, 3, 3, 0, 1, 7, 7, 7),(120, "2022-09-11 23:00:22.0", "2022-12-09 20:49:18.0", 13, 20, 5, 9, 0, 0, 10, 14, 33, 42, 4, 3, 0, 0, 8, 7, 1, 6, 0, 0, 2, 7, 8); INSERT INTO game VALUES (1781, "2022-09-11 23:00:2