INSERT INTO season VALUES (15, "2022-10-22 12:03:59.0", "2022-10-24 21:53:27.0", "AVES", 4, "Aves Season 15", 30, "In the third to last game of the season, Pelican's chances looked good. They could beat Peacock at home to seal the season, but they lost terribly 6-2 forcing themselves to need a win in the final game of the season to even tie Peacock. They didn't win that one either and came up one point behind the champ, Peacock. Peacock earned 5 points in their last 3 games which were all away. They also become the first team to score more than 8 points in a four team season in which all teams play 6 games.", "HOME_ROTATION_RANDOM"); INSERT INTO standing VALUES (130, "2022-10-22 12:03:59.0", "2022-12-09 20:49:18.0", 15, 30, 4, 1, 0, 1, 9, 6, 24, 18, 2, 1, 0, 0, 4, 3, 2, 0, 0, 1, 5, 3, 1),(131, "2022-10-22 12:03:59.0", "2022-12-09 20:49:18.0", 15, 31, 3, 1, 0, 2, 8, 6, 14, 16, 2, 1, 0, 0, 4, 3, 1, 0, 0, 2, 4, 3, 2),(132, "2022-10-22 12:03:59.0", "2022-12-09 20:49:18.0", 15, 32, 3, 3, 0, 0, 6, 6, 17, 20, 3, 0, 0, 0, 6, 3, 0, 3, 0, 0, 0, 3, 3),(129, "2022-10-22 12:03:59.0", "2022-12-09 20:49:18.0", 15, 29, 2, 4, 0, 0, 4, 6, 16, 17, 1, 2, 0, 0, 2, 3, 1, 2, 0, 0, 2, 3, 4); INSERT INTO game VALUES (1849, "2022-10-22 12:03:59.0", "2022-10-22 14:05:33.0", "HOCKEY", 15, 31, 29, 2, 1, "FINAL", 3),(1850, "2022-10-22 12:03:59.0", "2022-10-22 14:05:44.0", "HOCKEY", 15, 30, 32, 5, 2, "FINAL", 3),(1851, "2022-10-22 12:03:59.0", "2022-10-22 16:06:53.0", "HOCKEY", 15, 29, 32, 5, 3, "FINAL", 3),(1852, "2022-10-22 12:03:59.0", "2022-10-22 16:26:07.0", "HOCKEY", 15, 30, 31, 2, 1, "FINAL", 4),(1853, "2022-10-22 12:03:59.0", "2022-10-22 18:27:10.0", "HOCKEY", 15, 31, 32, 6, 4, "FINAL", 3),(1854, "2022-10-22 12:03:59.0", "2022-10-24 10:54:12.0", "HOCKEY", 15, 29, 31, 1, 2, "FINAL", 3),(1855, "2022-10-22 12:03:59.0", "2022-10-24 12:55:27.0", "HOCKEY", 15, 30, 29, 1, 4, "FINAL", 3),(1856, "2022-10-22 12:03:59.0", "2022-10-24 15:05:51.0", "HOCKEY", 15, 29, 30, 5, 7, "FINAL", 3),(1857, "2022-