INSERT INTO season VALUES (17, "2022-11-14 08:35:29.0", "2022-11-15 21:26:39.0", "AVES", 4, "Aves Season 17", 12, "Blue Jay was undefeated going into their last game having already clinched the season. They came up one goal short of a miraculous comeback against Canary and weren't able to complete the first perfect season ever. However, they've now accomplished exactly what Woodpecker has and in less seasons. They can make a strong case for having the most impressive performance in the entire league so far. Bluebird won every game except the two against Blue Jay. For the first time a season was ran in parallel to another season (Aves Season 18).", "HOME_ROTATION_RANDOM"); INSERT INTO standing VALUES (144, "2022-11-14 08:35:29.0", "2022-12-09 20:49:18.0", 17, 12, 5, 1, 0, 0, 10, 6, 24, 13, 3, 0, 0, 0, 6, 3, 2, 1, 0, 0, 4, 3, 1),(142, "2022-11-14 08:35:29.0", "2022-12-09 20:49:18.0", 17, 10, 4, 2, 0, 0, 8, 6, 13, 9, 2, 1, 0, 0, 4, 3, 2, 1, 0, 0, 4, 3, 2),(141, "2022-11-14 08:35:29.0", "2022-12-09 20:49:18.0", 17, 9, 2, 4, 0, 0, 4, 6, 14, 19, 2, 1, 0, 0, 4, 3, 0, 3, 0, 0, 0, 3, 3),(143, "2022-11-14 08:35:29.0", "2022-12-09 20:49:18.0", 17, 11, 1, 5, 0, 0, 2, 6, 6, 16, 1, 2, 0, 0, 2, 3, 0, 3, 0, 0, 0, 3, 4); INSERT INTO game VALUES (1917, "2022-11-14 08:35:29.0", "2022-11-14 10:37:24.0", "HOCKEY", 17, 12, 11, 5, 2, "FINAL", 3),(1918, "2022-11-14 08:35:29.0", "2022-11-14 12:38:36.0", "HOCKEY", 17, 10, 12, 1, 4, "FINAL", 3),(1919, "2022-11-14 08:35:29.0", "2022-11-14 14:55:47.0", "HOCKEY", 17, 10, 9, 4, 0, "FINAL", 3),(1920, "2022-11-14 08:35:29.0", "2022-11-14 16:57:05.0", "HOCKEY", 17, 12, 9, 5, 2, "FINAL", 3),(1921, "2022-11-14 08:35:29.0", "2022-11-14 18:39:33.0", "HOCKEY", 17, 11, 9, 2, 0, "FINAL", 3),(1922, "2022-11-14 08:35:29.0", "2022-11-14 18:39:59.0", "HOCKEY", 17, 12, 10, 3, 2, "FINAL", 3),(1923, "2022-11-14 08:35:29.0", "2022-11-14 20:41:16.0", "HOCKEY", 17, 9, 11, 5, 1, "FINAL", 3),(1924, "2022-11-14 08:35:29.0", "2022-11-15 10:39:21.0", "HOCKEY", 17, 11, 12