INSERT INTO season VALUES (19, "2022-11-16 08:37:03.0", "2022-11-23 13:18:20.0", "AVES", 16, "Aves Season 19", 32, "Roadrunner started hot winning their first 7, but then lost their next 3 falling out of contention momentarily. They hung around and emerged as one of many contenders towards the end, and won 7 of 8 to put themselves at the top of the standings. They finished with two losses but everyone else was too far behind and Roadrunner took Season 19! Flamingo and Penguin, the two most successful active teams, were two of the major contenders holding the top two spots at times. Eagle, another former winner, was a major contender especially late. When it appeared to be over, Turkey kept themselves alive longer than any other team by winning 6 straight. It looked like they might have a chance at a miracle on Thanksgiving week, but they lost 4 of their last 5 and fell far short. If they had won their last 3 they would have taken it.", "HOME_ROTATION_RANDOM"); INSERT INTO standing VALUES (157, "2022-11-16 08:37:03.0", "2022-12-09 20:49:18.0", 19, 32, 20, 8, 0, 2, 42, 30, 79, 69, 11, 3, 0, 1, 23, 15, 9, 5, 0, 1, 19, 15, 1),(163, "2022-11-16 08:37:03.0", "2022-12-09 20:49:18.0", 19, 26, 17, 7, 0, 6, 40, 30, 86, 72, 8, 4, 0, 3, 19, 15, 9, 3, 0, 3, 21, 15, 2),(160, "2022-11-16 08:37:03.0", "2022-12-09 20:49:19.0", 19, 29, 17, 10, 0, 3, 37, 30, 91, 78, 6, 6, 0, 3, 15, 15, 11, 4, 0, 0, 22, 15, 3),(151, "2022-11-16 08:37:03.0", "2022-12-09 20:49:19.0", 19, 19, 17, 11, 0, 2, 36, 30, 87, 80, 8, 5, 0, 2, 18, 15, 9, 6, 0, 0, 18, 15, 4),(155, "2022-11-16 08:37:03.0", "2022-12-09 20:49:19.0", 19, 23, 16, 10, 0, 4, 36, 30, 89, 83, 7, 4, 0, 4, 18, 15, 9, 6, 0, 0, 18, 15, 5),(153, "2022-11-16 08:37:03.0", "2022-12-09 20:49:19.0", 19, 21, 17, 12, 0, 1, 35, 30, 85, 80, 10, 4, 0, 1, 21, 15, 7, 8, 0, 0, 14, 15, 6),(164, "2022-11-16 08:37:03.0", "2022-12-09 20:49:19.0", 19, 25, 15, 11, 0, 4, 34, 30, 85, 77, 10, 4, 0, 1, 21, 15, 5, 7, 0, 3, 13, 15, 7),(158, "2022-11-16 08:37:03.0", "2022