INSERT INTO season VALUES (20, "2022-11-25 18:29:41.0", "2022-12-09 16:52:40.0", "AVES", 32, "Aves Season 20", 31, "In the first season with all teams since season 5, the finish was fittingly dramatic. Purple Martin won 17 of their first 20 games taking a commanding lead, but they tanked after that lossing game after game until they were caught. Several teams contended for the lead briefly and then Pelican emerged as the leader for a long time. As the season neared the end Pelican was in the driver's seat but they suffered a 6 game lossing streak at the worst time allowing Roadrunner to catch and pass them. Roadrunner won their last game putting the pressure on Pelican who had won 2 in a row but would need to win all of thier last 3 now to win the seaon. Pelican took care of business winning 2 at home and then faced Penguin in an away game. It was fitting that Penguin have a say in the winner of the season. Penguin had been a contender at times also coming one win away from the lead at one point. In a season of 992 games it had come down to the second to last scheduled game to decide a winner between Roadrunner and Pelican. Would Roadrunner win back to back seasons and secure themselves as the clear leader of the league or would Pelican win the coveted 32 team season. Penguin lead the game 4-2 briefly in the second peroid, but Pelican scored 3 straight scoring the game winning goal at 12:29 in the 3rd and took season 20!", "HOME_ROTATION_RANDOM"); INSERT INTO standing VALUES (195, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 31, 39, 18, 0, 5, 83, 62, 192, 163, 21, 6, 0, 4, 46, 31, 18, 12, 0, 1, 37, 31, 1),(196, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 32, 38, 18, 0, 6, 82, 62, 195, 160, 18, 10, 0, 3, 39, 31, 20, 8, 0, 3, 43, 31, 2),(193, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 29, 35, 19, 0, 8, 78, 62, 205, 186, 19, 7, 0, 5, 43, 31, 16, 12, 0, 3, 35, 31, 3),(176, "2022-11-25 18:29:41.0", "2022-12-09 20:49:19.0", 20, 12, 36, 21, 0,